df = pd.read_excel(file_path)

first_columns = df.iloc[:, :7]
last_columns = df.iloc[:, 7:]

for column in last_columns.columns:
    for index, value in last_columns[column].items():
        if str(value)[0] == "а":
            last_columns.at[index, column] = 1
        elif str(value)[0] == "б":
            last_columns.at[index, column] = 2
        elif str(value)[0] == "в":
            last_columns.at[index, column] = 3

result_df = pd.concat([first_columns, last_columns], axis=1)

